!function(){"use strict";angular.module("ngWeb").run(["$templateCache",function(t){t.put("article-item.html",'<div><div class="user-thumb"><span style="width:40px;height: 50px">{{item.formatTransfer}}</span></div><div class="article-post"><span class="user-info">By: microlv / 浏览：【{{item.visitCount}}】 / 发布日期：{{item.formatUpdateAt}}</span> <a herf="" data-ng-click="articleEdit(item)" data-ng-show="item.showEditButton"><i class="icon-pencil"></i></a><p style="margin: 5px 0 10px;"><a data-ng-href="{{item.href}}">{{item.title}}</a></p></div></div>'),t.put("dialog-modal.html",'<div><div class="modal-header"><h3 class="modal-title">{{title}}</h3></div><div class="modal-body">$$content$$</div><div class="modal-footer"><button class="btn btn-primary" data-ng-click="ok()">OK</button> <button class="btn btn-warning" data-ng-click="cancel()">Cancel</button></div></div>'),t.put("layout-content.html",'<div id="content"><div id="content-header"><div id="breadcrumb"><a ui-sref="topic" title="Go to Home" class="tip-bottom"><i class="icon-home"></i>Home</a></div></div><div ui-view=""></div></div>'),t.put("layout-footer.html",'<div class="row-fluid"><div id="footer" class="span12">2014-2015 &copy;Web design by <a href="https://github.com/microlv/" target="_blank">[microlv]</a> fork me on github: <a href="https://github.com/microlv/" target="_blank">[microlv]</a></div></div>'),t.put("layout-header.html",'<div style="height: 81px"><div id="user-nav" class="navbar navbar-inverse"><ul class="nav"><li data-ng-show="!systemUser.isAuth"><a href ng-click="login()"><i class="icon-github"></i> <span class="text">Login</span></a></li><li data-ng-show="systemUser.isAuth"><a><i class="icon icon-user"></i> <span class="text">{{systemUser.username}}</span></a></li></ul></div></div>'),t.put("layout-search.html",'<div id="search"><a href data-ui-sref="about"><span class="text">About Me</span></a> <a href data-ng-show="systemUser.isAdmin" data-ui-sref="edit-article"><span class="text">Post Article</span></a></div>'),t.put("layout-sidebar.html",'<div id="sidebar"><a class="visible-phone" href ui-sref="topic"><i class="icon icon-home"></i> Dashboard</a><ul><li data-ng-repeat="item in layoutSidebarItemSource"><a data-ng-href="{{item.href}}"><i class="icon" data-ng-class="item.iStyle"></i> <span>{{item.topic}}</span></a></li></ul></div>'),t.put("login-template.html",'<div><div class="modal-header"><h3 class="modal-title">{{title}}</h3></div><div class="modal-body"><a href="/api/auth/github"><img src="/images/github.jpg"> <span>使用GitHub</span></a></div><div class="modal-footer"><button class="btn btn-primary" data-ng-click="ok()">OK</button> <button class="btn btn-warning" data-ng-click="cancel()">Cancel</button></div></div>'),t.put("save-ok.html",'<div><div class="modal-header"><h3 class="modal-title">{{title}}</h3></div><div class="modal-body"><div>Save is OK</div></div><div class="modal-footer"><button class="btn btn-primary" data-ng-click="ok()">OK</button> <button class="btn btn-warning" data-ng-click="cancel()">Cancel</button></div></div>'),t.put("topic-category.html",'<div class="widget-content nopadding collapse in"><ul class="recent-posts"><li data-ng-repeat="item in itemSource"><div data-article-item data-item="item"></div></li></ul></div>'),t.put("topic-items.html",'<ul class="quick-actions"><li data-ng-class="item.liStyle" data-ng-repeat="item in itemSource"><a data-ng-href="{{item.href}}"><i data-ng-class="item.iStyle"></i> <span data-ng-show="item.number" class="label label-important">{{item.number}}</span> {{item.topic}}</a></li></ul>')}])}();